import React from 'react';
import { HeaderBlock, HeaderSection, HeaderSectionText } from './styles';
import Nav from '../Nav';

const AppHeader = () => {
  return (
    <HeaderBlock>
      <HeaderSection>
        <Nav />
      </HeaderSection>
      <HeaderSection>
        <HeaderSectionText>Hello</HeaderSectionText>
      </HeaderSection>
    </HeaderBlock>
  );
};

export default AppHeader;
